public class MemcachedCacheProvider : ICacheProvider\n{\n    private readonly MemcachedClient _memcachedClient;\n\n    public MemcachedCacheProvider(MemcachedClient memcachedClient)\n    {\n        _memcachedClient = memcachedClient;\n    }\n\n    public void Delete(string key)\n    {\n        _memcachedClient.Delete(key);\n    }\n\n    public object Get(string key)\n    {\n        return _memcachedClient.Get(key);\n    }\n\n    public bool HasKey(string key)\n    {\n        return _memcachedClient.KeyExists(key);\n    }\n\n    public void Store(string key, object data)\n    {\n        _memcachedClient.Store(key, data);\n    }\n}